import './cart-item.scss'

const CartItem = ({ cartItem }) => {
  const { name, imageUrl, price, quantity } = cartItem
  return (
    <div className='cart-item-container'>
      <img src={imageUrl} alt={`${name}`}/>
      <h2>{name}</h2>
      <span>{quantity}</span>
    </div>
  )
}

export default CartItem
